import React from 'react';
import { Navigate} from "react-router-dom";

const ProtectedRoute = ({
  hasAccess, component: Component
}) => {
  console.log('protected hasAccess', hasAccess, component);
  return (hasAccess ? <Component {...props}/> : <Navigate to="./signup" />)
}

export default ProtectedRoute;
